    mapping (address => uint) public pendingwithdrawals;

    uint8 public mode;
    uint256 public searchseed;

    function makeAdoptionOffer(bytes5 arg1, uint256 arg2) public {
        require(balanceOf[arg1] > 0 && arg2 > 0, "Invalid argument values");
        balance2[arg1][0] = 1;
        balance2[arg1][1] = uint(keccak256(abi.encodePacked(arg1)));
        balance2[arg1][2] = uint(msg.sender);
        balance2[arg1][3] = arg2;
        balance2[arg1][4] = 0;
    }

    function activate() public {
        require(mode <= 3 && mode == 0, "Invalid mode");
        searchseed = uint(blockhash(block.number + 0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff));
        mode = 3;
    }

    function withdraw() public {
        uint amount = pendingwithdrawals[msg.sender];
        pendingwithdrawals[msg.sender] = 0;
        msg.sender.call.value(amount)("");
    }

